import logo from './logo.svg';
import './App.css';
// Single widget
import { Dashboard, Meeting, Team } from '@iotum/callbridge-js';
import { useEffect } from 'react';

function newMeeting() {
  const widget = new Meeting({"domain":"iotum.callbridge.rocks","container":"#ifrm_container"}, 5821515, {"name":"Guest","view":"left_side_speaker","tiles":4,"resolution":180,"mute":{"mic":true,"camera":true}});
  return widget;
}

function dashboard() {
  const widget = new Dashboard({"domain":"iotum.callbridge.rocks","container":"#team_container"}, Team, {});

  return widget;
}

function App() {
  useEffect(() => {
    newMeeting();
    dashboard();
  });
  return (
    <div className="App">
      <div id="ifrm_container"></div>
      <div id="team_container"></div>
    </div>
  );
}

export default App;
